import './Signup.css';
import email from "./../image/email.png";
import pass from "./../image/lock.png";
import React from "react";
import logo from "./../image/logo.png"
import user from "./../image/user.png"
function Signup() {
  var password = document.getElementById("password")
  , confirm_password = document.getElementById("confirm_password");

function validatePassword(){
  if(password.value != confirm_password.value) {
    confirm_password.setCustomValidity("Passwords Don't Match");
  } else {
    confirm_password.setCustomValidity('');
  }
}

// password.onchange = validatePassword;
// confirm_password.onkeyup = validatePassword;
  return (
    
    <div className='s_img'>
      <meta name="viewport" content="width=device-width,initial-scale=1"/>

    <div className='s_suvi'>
      Space Energy Systems
    </div> 
    <div className="s_main" >
     <div className="s_intro">
      
        <h1>EVERYTHING EASY AND ECONOMICAL</h1>
        <p>Construction application that gets you easy access to building information, create plan, schedule, resources, material and related services at your fingertips.</p>
      
     </div>
     <div className='s_frame'>
     <div className="s_sub-main">
       
         <div >
         <div className='s_title-logo'>
         <img src={logo} alt="logo" className="s_logo-pic"/>
         </div> 
         <div>
          <form name='form2' autocomplete="off">
          <div>
            <img src={user} alt="user" className="s_name-pic"/>
             <input type="text" placeholder="Name" className="s_name" required/><br></br>
          </div>
           <div className="s_second-input">
             <img src={email} alt="email" className="s_email-pic"/>
             <input type="email" placeholder="Email" className="s_name" required/><br></br>
           </div>
           <div className="s_second-input">
             <img src={pass} alt="pass" className="s_email-pic"/>
             <input type="password" id='password' placeholder="4-digit pin" pattern='^\d{4}$' className="s_name" required/><br></br>
           </div>
           <div className="s_second-input">
             <img src={pass} alt="pass" className="s_email-pic"/>
             <input type="password" id='confirm_password' placeholder="Confirm pin" pattern='^\d{4}$' className="s_name" required/><br></br>
           </div>
          <br></br>
          
          <button type='submit' >Signup</button>
          
       
           <p>
              <a>Already have an account?</a>
              <br></br>
              <a href="/" >Login</a>
            </p>
            <br></br>
           
            </form> 
         </div>
       
       
         </div>
      </div> 
      </div>
    </div>
    </div>
  );
}

export default Signup;
